function Layout(props) {
  return (
    <div className="flex flex-col h-screen lg:flex-row">
      {props.children}

      <style jsx global>{`
        @font-face {
          font-family: "Edmondsans";
          src: url("/static/fonts/Edmondsans-Regular.otf");
          font-display: auto;
          font-style: normal;
        }
        @font-face {
          font-family: "Edmondsans-medium";
          src: url("/static/fonts/Edmondsans-Medium.otf");
          font-display: auto;
          font-style: normal;
          font-weight: 500;
        }
        .font-edmondsans {
          font-family: "Edmondsans";
        }
        .font-edmondsans-medium {
          font-family: "Edmondsans-medium";
        }
        .input {
          background-color: rgb(255, 255, 255);
          border-bottom-color: rgb(183, 183, 183);
          border-bottom-left-radius: 4px;
          border-bottom-right-radius: 4px;
          border-bottom-style: none;
          border-bottom-width: 0px;
          border-image-outset: 0px;
          border-image-repeat: stretch;
          border-image-slice: 100%;
          border-image-source: none;
          border-image-width: 1;
          border-left-color: rgb(183, 183, 183);
          border-left-style: none;
          border-left-width: 0px;
          border-right-color: rgb(183, 183, 183);
          border-right-style: none;
          border-right-width: 0px;
          border-top-color: rgb(183, 183, 183);
          border-top-left-radius: 4px;
          border-top-right-radius: 4px;
          border-top-style: none;
          border-top-width: 0px;
          box-sizing: border-box;
          color: rgb(74, 74, 74);
          cursor: text;
          display: block;
          font-size: 16px;
          font-stretch: 100%;
          font-style: normal;
          font-variant-caps: normal;
          font-variant-east-asian: normal;
          font-variant-ligatures: normal;
          font-variant-numeric: normal;
          font-weight: 400;
          height: 56px;
          letter-spacing: normal;
          line-height: 24px;
          margin-bottom: 0px;
          margin-left: 0px;
          margin-right: 0px;
          margin-top: 0px;
          padding-bottom: 1px;
          padding-left: 8px;
          padding-right: 0px;
          padding-top: 1px;
          tab-size: 4;
          text-align: start;
          text-indent: 0px;
          text-rendering: auto;
          text-shadow: none;
          text-size-adjust: 100%;
          text-transform: none;
          width: 616px;
          word-spacing: 0px;
          writing-mode: horizontal-tb;
          -webkit-appearance: none;
          -webkit-font-smoothing: antialiased;
          -webkit-rtl-ordering: logical;
          -webkit-border-image: none;
        }
      `}</style>
    </div>
  );
}

export default Layout;
